(function() {
  var AboutMe, ready;

  AboutMe = {
    "new": function() {
      var obj;
      obj = this;
      $(".nav .page-header").on("click", "a", function() {});
      return obj.show_box_by();
    },
    show_box_by: function() {
      return $(".with-tooltips").on("click", function() {
        var box, section;
        section = $(this).parent();
        box = $(".box-tool", section);
        $(".box-tool").addClass("hidden");
        return box.removeClass("hidden");
      });
    },
    to_show: function(selector) {
      var obj;
      obj = this;
      if (selector.data("show") === "biography") {
        return obj.show($(".home-container #biography"));
      } else if (selector.data("show") === "knowledge") {
        return obj.show($(".home-container #knowledge"));
      } else {
        return obj.show($(".home-container #abilities"));
      }
    },
    show: function(section) {
      return section.removeClass("hidden");
    },
    hidden: function(section) {
      return section.addClass("hidden");
    }
  };

  ready = function() {
    return AboutMe["new"]();
  };

  $(document).on('ready', ready);

  $(document).on('page:load', ready);

}).call(this);
